import React from "react";
import ReactDOM from "react-dom/client";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Navbar from "./components/Navbar";
import Home from "./pages/Home";
import AboutPage from "./pages/AboutPage";
import Education from "./pages/Education";
import Projects from "./pages/Projects"; // Import Projects page
import Skills from "./pages/Skills"; // Import Skills Page
import "./styles/global.css";

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    <Router>
      <Navbar />
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/about" element={<AboutPage />} />
        <Route path="/education" element={<Education />} />
        <Route path="/projects" element={<Projects />} /> {/* Added Projects Route */}
        <Route path="/skills" element={<Skills />} /> {/* Add Route for Skills */}
      </Routes>
    </Router>
  </React.StrictMode>
);
